import React from "react";
import "./App.css";

function App() {
   function EachSquare(props) {
      return (
         <button className='square' onClick={props.handleClick}>
            {props.value}
         </button>
      );
   }

   return (
      <div>
         <EachSquare />
      </div>
   );
}

export default App;
